audio1 = new Audio('data:audio/x-wav;base64,');
const audioCtx = new (window.AudioContext)();
const file = document.getElementById('fileupload');

const container = document.getElementById('container');
const canvas = document.getElementById('canvas1')
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;

const ctx = canvas.getContext('2d');
let audioSource;
let analyser;

container.addEventListener('click', function(){
  audio1.play();
  audioSource = audioCtx.createMediaElementSource(audio1);
  analyser = audioCtx.createAnalyser();
  audioSource.connect(analyser);
  analyser.connect(audioCtx.destination);
  analyser.fftSize = 128;
  const bufferLenght = analyser.frequencyBinCount;
  const dataArray = new Uint8Array(bufferLenght);


  const barWidth = 5
  let barHeight;
  let x;

  function animate(){
    x = 0;
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    analyser.getByteFrequencyData(dataArray);
    drawVisualizer(bufferLenght, x, barWidth, barHeight, dataArray)
    requestAnimationFrame(animate);
  }

  animate()
});

file.addEventListener('change', function(){
  console.log(this.files);
  const files = this.files
  const audio1 = document.getElementById('audio1');
  audio1.src = URL.createObjectURL(files[0]);
  audio1.load();
  audio1.play();
  audioSource = audioCtx.createMediaElementSource(audio1);
  analyser = audioCtx.createAnalyser();
  audioSource.connect(analyser);
  analyser.connect(audioCtx.destination);
  analyser.fftSize = 128;
  const bufferLenght = analyser.frequencyBinCount;
  const dataArray = new Uint8Array(bufferLenght);


  const barWidth = (canvas.width/2)/bufferLenght;
  let barHeight;
  let x;

  function animate(){
    x = 0;
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    analyser.getByteFrequencyData(dataArray);
    drawVisualizer(bufferLenght, x, barWidth, barHeight, dataArray)
    requestAnimationFrame(animate);
  }

  animate()
})

function drawVisualizer(bufferLenght, x, barWidth, barHeight, dataArray){
  for (let i = 0; i < bufferLenght; i++) {
    barHeight = dataArray[i] * 1.5;
    ctx.save();
    ctx.translate(canvas.width/2, canvas.height/2);
    ctx.rotate(i * Math.PI * 4 / bufferLenght);
    const hue = i * 8;

    ctx.fillStyle = 'hsl('+ hue + ',100%, 50%)';
    ctx.fillRect(0, 0, barWidth, barHeight);
    x += barWidth;
    ctx.restore();
  }

}
